import React from 'react'
import { Button, FormGroup, Label, Input, FormText, Container } from 'reactstrap';
import FormControl from 'react-bootstrap-forms';
import "bootstrap/dist/css/bootstrap.css";


class Login extends React.Component {
    userName = '';

    loginClicked = (e) => {
        this.userName = e.target.value[0];
        document.getElementById("login-form").classList.add("hide");
        var confirmLogin = document.createElement("div");
        confirmLogin.innerHTML = "Yay! You have logged in! Congrats " + this.userName;
        document.getElementById("login").appendChild(confirmLogin);
    }

    render() {
        return (
            <Container className="custom-text" id="login">
            <h1 id="login-title">Login:</h1>
            <FormGroup id="login-form">
                <h4>Enter username and password below to login!</h4>
                <br></br>
                <FormGroup>
                    <Label for="exampleName"><h4>Username</h4></Label>
                    <Input type="name" name="name" id="exampleName" placeholder="Enter email" onChange={this.handleEmailChange} />
                </FormGroup>
                <FormGroup>
                    <Label for="exampleEmail"><h4>Password</h4></Label>
                    <Input type="password" name="password" id="password" placeholder="Password" onChange={this.handlePasswordChange} />
                </FormGroup>
                <Button onClick={this.loginClicked}>Login</Button>
            </FormGroup>
            </Container>
            // <Container className="custom-text">
